import * as React from 'react';
import Themes from './src/util/Themes'
import {
  StyleSheet,
  useColorScheme,
  View,
} from 'react-native';
import {UserStateReducer, setName} from './src/redux/UserState'
import { NavigationContainer } from '@react-navigation/native'
import Logo from './src/components/Logo';
import IndexScreen from './src/screens/IntroScreen/IndexScreen';

const userStore = createStore(UserStateReducer)

const App = () => {
  const userTheme = useColorScheme();
  window.setName = setName
  return (
    <NavigationContainer theme={Themes.DarkTheme}>
      <Provider store={userStore}>
        <IndexScreen/>
      </Provider>
    </NavigationContainer>
  );
};




export default App;
